        /// <summary>
        /// 緯度・経度からFlinn-Engdahl regions codeを返します。
        /// </summary>
        /// <param name="Lat">緯度</param>
        /// <param name="Lon">経度</param>
        /// <returns>Flinn-Engdahl regions code</returns>
        /// <exception cref="ArgumentOutOfRangeException"></exception>
        public static int Code(double Lat, double Lon)
        {
            if (Lat > 90 || Lat < -90)
                throw new ArgumentOutOfRangeException($"指定された引数\"Lat\"は値の有効な範囲内にありません。({Lat})");
            if (Lon < -180 || Lon > 180)
                throw new ArgumentOutOfRangeException($"指定された引数\"Lon\"は値の有効な範囲内にありません。({Lon})");
            int LatI = (int)Math.Floor(90 - Lat);
            int LonI = (int)Math.Floor(180 + Lon);
            return codes[LatI, LonI];
        }

